import React, { Fragment } from "react";
//import spinner

import spinner from "./spinner.gif";

const Spinner = () => {
  return (
    <Fragment>
      <img
        src={spinner}
        style={{
          width: "200px",
          height: "200px",
          margin: "auto",
          display: "block",
        }}
        alt='spinner'
      />
    </Fragment>
  );
};

export default Spinner;
